import React from 'react'

const LinkedInLogin = () => {
  return (
    <Button color="linkedin" size="sm" type="button">
      <span className="btn-inner--icon">
        <i className="fab fa-linkedin"></i>
      </span>
    </Button>
  )
}

export default LinkedInLogin
